import React from "react";
import { wrapper } from "../redux/index";
import { Provider } from "react-redux";

const MyApp = ({ Component, pageProps }) => {
  return;
  <Provider store={store}>
    <Component {...pageProps} />
  </Provider>;
};

export default wrapper.withRedux(MyApp);
